	let rando = Math.random()
	console.log(rando)
	setHeadingText(rando)

}

function App(){
	return (<>
		<Heading/>
		<div>
			<div className="test" onClick={getNum}>{headingText}</div>
		</div>
	</>)
}

export default App;
